import React from "react";
import Button from "./Boxes/Button.tsx";
import {
  FrontPageButtonStyle,
  FrontPageStyle,
} from "../../styles/FrontPageStyle/FrontPage.style.ts";

declare module "*.jpg" {
  const path: string;
  export default path;
}

declare module "*.png" {
  const path: string;
  export default path;
}import Text1 from "./Boxes/Text1.tsx";

function FrontPage() {
  return (
    <FrontPageStyle>
      <Text1 />
      <Text2 />
      <h2>Creative developer & student at 42 Paris</h2>
      <FrontPageButtonStyle>
        <Button />
      </FrontPageButtonStyle>
    </FrontPageStyle>
  );
}

export default FrontPage;
